USE EightWeekSQLChallenge;
--CREATE SCHEMA fresh_segments;
--
DROP TABLE IF EXISTS fresh_segments.interest_map;
CREATE TABLE fresh_segments.interest_map (
  "id" INTEGER,
  "interest_name" TEXT,
  "interest_summary" TEXT,
  "created_at" DATETIME2,
  "last_modified" DATETIME2
);


  
-- update the null values
UPDATE fresh_segments.interest_map
SET interest_summary = NULL
WHERE interest_summary LIKE '';
--
DROP TABLE IF EXISTS fresh_segments.interest_metrics;
CREATE TABLE fresh_segments.interest_metrics (
  "_month" VARCHAR(4),
  "_year" VARCHAR(4),
  "month_year" VARCHAR(7),
  "interest_id" VARCHAR(5),
  "composition" FLOAT,
  "index_value" FLOAT,
  "ranking" INTEGER,
  "percentile_ranking" FLOAT
);

BULK INSERT fresh_segments.interest_metrics
FROM 'C:\Users\Taufik\Documents\Fresh-Segments-Interest-Matrics.csv'
WITH (FIRSTROW = 1,
    FIELDTERMINATOR = ',',
    ROWTERMINATOR='\n');

-- update NULL values
UPDATE fresh_segments.interest_metrics
SET _month = CASE WHEN _month = 'NULL' THEN CAST(NULL AS int) ELSE CAST(_month AS int) END;

UPDATE fresh_segments.interest_metrics
SET _year = CASE WHEN _year = 'NULL' THEN CAST(NULL AS int) ELSE CAST(_year AS int) END;

UPDATE fresh_segments.interest_metrics
SET month_year = NULL
WHERE month_year = 'NULL';

UPDATE fresh_segments.interest_metrics
SET interest_id = NULL
WHERE interest_id = 'NULL';
